package main

import (
	"encoding/json"
	"fmt"
	"image2hex/util"
	"log"
)

func main() {
	env := &util.Environment{}

	var rawImage json.RawMessage

	rawImage = []byte(`{
		"data": "data:image/svg+xml;base64,",
		"name": "baloon7.svg",
		"size" : 100661
		}`)
	image, err := util.SaveImageData(env, rawImage)
	if err != nil {
		fmt.Println(err)
		return
	}

	lans, err := json.Marshal(image)
	if err != nil {
		fmt.Println(err)
		return
	}

	log.Println(lans)

}
